import ReactDOM from "react-dom/client";
import React from "react";
import homeHeader from "../Images/HomeImg/HomeSampleimg1.webp";

function Home() {
  return (
    <div className="grid grid-cols-1 bg-neutral gap-10">
      <div className="card">
        <img className=" " src={homeHeader}></img>
      </div>

      <div className="mt-8 grid grid-cols-1 bg-neutral gap-10">
        <div className="card">
          <img
            src={homeHeader}
            alt="filler"
            class="w-full h-32 sm:h-48 object-cover"
          ></img>

          <div className="m-4">
            <span className="block text-gray-500 text-sm">BBC Case Study</span>
          </div>
        </div>

        <div className="card">
          <img
            className="w-full h-32 sm:h-48 object-cover"
            src={homeHeader}
          ></img>

          <div className="m-4">
            <span className="block text-gray-500 text-sm">
              Portfolio Website
            </span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
